import React, { useState } from 'react';

function App() {
    const [phoneNumber, setPhoneNumber] = useState('');
    const [countryCode, setCountryCode] = useState('+1'); // default to +1
    const countries = [
        { code: '+1', name: 'United States' },
        { code: '+45', name: 'Denmark' },
        // Add other countries here as needed
    ];

    const handleKeyPress = (key) => {
        setPhoneNumber(prev => prev + key);
    };

    const handleClear = () => {
        setPhoneNumber('');
    };

    const handleDelete = () => {
        setPhoneNumber(prev => prev.slice(0, -1));
    };

    return (
        <div className="min-h-screen bg-gray-200 flex flex-col justify-center items-center">
            <div className="mb-4 text-2xl font-semibold">Your phone number is your claim ticket</div>
            <div className="mb-4 bg-white p-4 rounded w-64">
                <div className="flex border-b mb-4">
                    <select
                        className="mr-2 border-r p-2"
                        value={countryCode}
                        onChange={(e) => setCountryCode(e.target.value)}
                    >
                        {countries.map(country => (
                            <option key={country.code} value={country.code}>
                                {country.name}
                            </option>
                        ))}
                    </select>
                    <input
                        type="tel"
                        readOnly
                        className="flex-1 text-center"
                        value={countryCode + phoneNumber}
                    />
                </div>
                <div className="grid grid-cols-3 gap-2">
                    {['1', '2', '3', '4', '5', '6', '7', '8', '9', 'Clear', '0', 'X'].map(key => (
                        <button
                            key={key}
                            className="w-full h-10 bg-gray-300 rounded hover:bg-gray-400"
                            onClick={() => {
                                if (key === 'Clear') handleClear();
                                else if (key === 'X') handleDelete();
                                else handleKeyPress(key);
                            }}
                        >
                            {key}
                        </button>
                    ))}
                </div>
            </div>
            <button className="mb-2 bg-blue-500 text-white p-2 rounded w-64 hover:bg-blue-600">Confirm</button>
            <div className="text-xs text-gray-600">
                By confirming, you agree to Privacy Policy &amp; Terms &amp; Conditions.
            </div>
        </div>
    );
}

export default App;
